import React from 'react';
import { IonHeader, IonToolbar, IonPage, IonTitle, IonContent } from '@ionic/react';

const Tab3Page: React.FC = () => {
    return (
        <IonPage>
            <IonHeader>
                <IonToolbar>
                    <IonTitle>Tab Three</IonTitle>
                </IonToolbar>
            </IonHeader>
            <IonContent />
        </IonPage>
    );
};

export default Tab3Page;
